var Asteroids = function(lpcanvas,lpasteroids=40,lpplanets=10,lpstars=200,lpbackground = "rgb(0,0,0)"){
	//Define library properties
	this.Asteroids = {
		Canvas : document.getElementById(lpcanvas),
		Mouse : {PosX: null,PosY: null,Gravity: 200, Radio : 5},
		PlanetsImgUrl : "data:image/png;base64,",
		PlanetsImg : new Image(),
		AsteroidsCount : lpasteroids,
		PlanetsCount : lpplanets,
		StarsCount : lpstars,
		PlanetsList : [],
		AsteroidsList : [],
		StarsList : [],
	}
	//Create canvas
	Asteroids.Context = Asteroids.Canvas.getContext("2d");
	Asteroids.CanvasPosition = Asteroids.Canvas.getBoundingClientRect();
	Asteroids.Canvas.style.background = lpbackground;
	//create image of planets
	Asteroids.PlanetsImg.src =  Asteroids.PlanetsImgUrl;
	//write the stars
	for (var i = 0; i < Asteroids.StarsCount; i++){
		Asteroids.StarsList.push({x:Asteroids.Canvas.width * Math.random(),y:Asteroids.Canvas.height * Math.random()});
	};
	Asteroids.StarsDraw = function(){
		Asteroids.Context.fillStyle = "rgb(255,255,255)";
		for (var i= 0;i< Asteroids.StarsList.length;i++) {
			Asteroids.Context.beginPath();
			Asteroids.Context.arc(Asteroids.StarsList[i].x, Asteroids.StarsList[i].y, Math.random()*2, 0, Math.PI*2, true);
			Asteroids.Context.closePath();
			Asteroids.Context.fill();
		}
	};
	//initializer of planets
	Asteroids.Planet = function(lpIndex){
		this.Planet = {
			Radio : 0,
			PlanetaX : Math.round(Math.random()*9),
			PlanetaY : Math.round(Math.random()*6),
			PosX : 0,
			PosY :  0,
			MaxY : 0,
			MaxX : 0 ,
			Angle : Math.round(Math.random()*360),
			Speed : Math.random()*0.05 + 0.02,
			Gravity : 0,
			Index: lpIndex,
			Pmed:0,
			PMax:0,
			Pmin:0,
		};
		//////////////////////////////
		this.Planet.Pmed = (Asteroids.Canvas.height/2-30)/(Asteroids.PlanetsCount-1);
		this.Planet.PMax = Math.round(this.Planet.Pmed*(i+1));
		this.Planet.PMin = Math.round(this.Planet.Pmed*(i)) ;
		
		this.Planet.Radio = Math.round(Math.random()*(this.Planet.Pmed/8) + this.Planet.Pmed/8);
		this.Planet.Gravity = this.Planet.Radio*5
		
		this.Planet.MaxY = Asteroids.Canvas.height/2  -this.Planet.PMin+this.Planet.Radio + Math.random()*(this.Planet.Pmed-this.Planet.Radio*2);
		this.Planet.MaxX =  (this.Planet.MaxY*100/(Asteroids.Canvas.height))*Asteroids.Canvas.width/100;
		
		this.Planet.PosY = this.Planet.MaxY ;
		this.Planet.PosX = 600 ;
		//draw planet
		this.Planet.Draw = function() {
			Asteroids.Context.drawImage(Asteroids.PlanetsImg,this.PlanetaX*38 -2,this.PlanetaY*33,38-8,30,this.PosX-this.Radio,this.PosY-this.Radio,this.Radio*2,this.Radio*2);
		}
		//update planet position
		this.Planet.Update = function() {
			this.Angle += ((this.Angle>359)? - 360:0)  + this.Speed;
			//use thw parametric equation of an ellipse to calc position
			this.PosX = Asteroids.Canvas.width/2 + this.MaxX* (Math.cos(this.Angle*Math.PI/180) );
			this.PosY = Asteroids.Canvas.height/2 + this.MaxY* (Math.sin(this.Angle*Math.PI/180) );
		};
		
	};
	//initializer of asteroids
	Asteroids.Asteroid = function(lpIndex){
		this.Asteroid = {
			x : 0,
			y : 0,
			xi : 0,
			yi : 0,
			angle : 0,
			size : 0,
			Color : '',
			LastPos : [{x:0,y:0},{x:0,y:0},{x:0,y:0},{x:0,y:0},{x:0,y:0},{x:0,y:0},{x:0,y:0},{x:0,y:0},{x:0,y:0},{x:0,y:0},{x:0,y:0},{x:0,y:0},{x:0,y:0},{x:0,y:0},{x:0,y:0},{x:0,y:0},{x:0,y:0},{x:0,y:0},{x:0,y:0},{x:0,y:0},]
		}
		//call when create or destroy asteroid
		this.Asteroid.Deploit = function(){
			this.x = Asteroids.Canvas.width * Math.random();
			this.y = Asteroids.Canvas.height * Math.random();
			this.xi = 0;
			this.yi = 0;
			this.angle = Math.round(Math.random()*360);
			this.size = Math.random()*4+1;
			this.Color = Asteroids.GetRandomColor();
		}
		//when destroy an asteroid
		this.Asteroid.Redeploit = function(){
			this.Deploit();
			this.y = 1;
			this.angle = Math.round(Math.random()*90);
			for(var i=0;i<20;i++){
				this.LastPos[i]={x:this.x,y:this.y};
			}
		}
		//draw the asteroids
		this.Asteroid.Draw = function() {
			for(var i = 0; i < this.LastPos.length; i++){
				Asteroids.Context.beginPath();
				Asteroids.Context.fillStyle = this.Color;
				Asteroids.Context.arc(this.LastPos[i].x, this.LastPos[i].y, ((i)/10), 0, Math.PI*2, true);
				Asteroids.Context.closePath();
				Asteroids.Context.fill();
			}
		}
		
		//calc the new position of asteroid
		this.Asteroid.Update = function() {
			this.xi = this.LastPos[10].x;
			this.yi = this.LastPos[10].y;
			this.x += this.size*Math.sin(this.angle*(Math.PI / 180));
			this.y += this.size*Math.cos(this.angle*(Math.PI / 180));
			//Update the 10 points to write
			this.LastPos.splice(0,1)
			this.LastPos.push({x:this.x,y:this.y})
			//validate every object in the space
			this.ValidateCollision(Asteroids.Mouse);
			for(i = 0 ; i < Asteroids.PlanetsList.length ; i++){
				this.ValidateCollision(Asteroids.PlanetsList[i].Planet);
			}
		};
		//validate if have a collision
		this.Asteroid.ValidateCollision = function(lpObject) {
			//calc len between actual object and current position and if lower than radius affect trayect
			let Diagonal = Math.sqrt(Math.pow((lpObject.PosX - this.x),2) + Math.pow((lpObject.PosY - this.y),2));
			if(Diagonal < lpObject.Gravity){
				if(Diagonal < lpObject.Radio -1){
					this.Redeploit();
				}else{
					//calculate triangle and angles between object an end of asteroid
					let AstX = lpObject.PosX-this.xi;
					let AstY = -(lpObject.PosY-this.yi);
					let AstDiag = Math.sqrt(Math.pow((AstX),2) + Math.pow((AstY),2));
					let AStAngSen = (Math.asin(AstY/AstDiag)/(Math.PI / 180));
					let AStAngTan = (Math.atan(AstY/AstX)/(Math.PI / 180));
					switch (true) {
						case (Math.sign(AStAngSen) == 1 && Math.sign(AStAngSen) == Math.sign(AStAngTan)):
							AStAngSen += 90;
							break;
						case (Math.sign(AStAngSen) == -1 && Math.sign(AStAngSen) == -Math.sign(AStAngTan)):
							AStAngSen = ((90-AStAngSen)+180);
							break;
						case (Math.sign(AStAngSen) == -1 && Math.sign(AStAngSen) == Math.sign(AStAngTan)):
							AStAngSen += 90;
							break;
						case (Math.sign(AStAngSen) == 1 && Math.sign(AStAngSen) == -Math.sign(AStAngTan)):
							AStAngSen = ((90-AStAngSen)+180);
							break;
						default:
							break;
					}
					let angle1fix = (this.angle+180<AStAngSen) ? this.angle+360: this.angle;
					let angle2fix = (this.angle-180>AStAngSen) ? AStAngSen+360 : AStAngSen;
					if(angle2fix<angle1fix){
						this.angle  -= (this.angle>0)? 1:-358;
					}
					else if(angle2fix>angle1fix){
						this.angle  += (this.angle<360)? 1:-360;
					}
					if(this.size>0.5)
						this.size-=0.001;
				}
			}else{
				//if haven't collision verify collision with borders 
				if(this.x < 0){
					this.x=0;
					this.angle += ((this.angle<=270)?-90:0)+((this.angle>270)?90:0);
				}
				if (this.x > Asteroids.Canvas.width){
					this.x=Asteroids.Canvas.width;
					this.angle += ((this.angle<=90)?-90:0)+((this.angle>90)?90:0);
				}
				if (this.y < 0){
					this.y =0;
					this.angle += ((this.angle<=180)?-90:0)+((this.angle>180)?90:0);
				}
				if (this.y > Asteroids.Canvas.height){
					this.y = Asteroids.Canvas.height;
					this.angle += ((this.angle<=180)?+90:0)+((this.angle>180)?-90:0);
				}
				//fix the angle to between 0 and 360 
				this.angle += ((this.angle > 360)? -360 : 0 ) +  ((this.angle < 0)? +360 : 0 )
			}
		}
		this.Asteroid.Deploit();
	};
	//loop in the canvas
	Asteroids.loop = function() {
		Asteroids.Context.clearRect(0, 0, Asteroids.Canvas.width, Asteroids.Canvas.height);
		Asteroids.StarsDraw();
		for (var i= 0;i< Asteroids.PlanetsList.length;i++) {
			Asteroids.PlanetsList[i].Planet.Update();
			Asteroids.PlanetsList[i].Planet.Draw();
		}
		for (var i= 0;i< Asteroids.AsteroidsList.length;i++) {
			Asteroids.AsteroidsList[i].Asteroid.Update();
			Asteroids.AsteroidsList[i].Asteroid.Draw();
		}
		requestAnimationFrame(Asteroids.loop);
	};
	//get the mouse position
	Asteroids.MousePosition = function(){
		window.addEventListener('mousemove', 
			function(e){
				Asteroids.Mouse.PosX = e.x - Asteroids.CanvasPosition.left;
				Asteroids.Mouse.PosY = e.y - Asteroids.CanvasPosition.top;
		});
	};
	Asteroids.MousePosition();
	//generate a random color for the asteroids
	Asteroids.GetRandomColor = function(){
		var r = 0, g = 0, b = 0;
		r = Math.floor(Math.random() * 156+100);
		g = Math.floor(Math.random() * 156+100);
		b = Math.floor(Math.random() * 156+100);
		//r = 255;
		//g = Math.floor(Math.random() * 56+200);
		//b = Math.floor(Math.random() * 56+200);
		return "rgba(" + r + "," + g + ","  + b + ",0.4)";
	};
	//init the definition of the asteroids and planets
	for (var i = 0; i < Asteroids.AsteroidsCount; i++){
		Asteroids.AsteroidsList.push(new Asteroids.Asteroid(i));
	};
	for (var i = 0; i < Asteroids.PlanetsCount; i++){
		Asteroids.PlanetsList.push(new Asteroids.Planet(i));
		if(i == (Asteroids.PlanetsCount-1)){
			Asteroids.PlanetsList[i].Planet.PosX = Asteroids.Canvas.width/2;
			Asteroids.PlanetsList[i].Planet.PosY = Asteroids.Canvas.height/2;
			Asteroids.PlanetsList[i].Planet.MaxY = 0;
			Asteroids.PlanetsList[i].Planet.MaxX = 0;
			Asteroids.PlanetsList[i].Planet.Radio = 30;
			Asteroids.PlanetsList[i].Planet.Speed = 0;
			Asteroids.PlanetsList[i].Planet.Gravity = 90;
			Asteroids.PlanetsList[i].Planet.PlanetaX = 10;
			Asteroids.PlanetsList[i].Planet.PlanetaY = 0;
		}
	};
	Asteroids.loop();
};

